import BlogListItem from './BlogListItem';
import { Article } from '../pages';

interface Props {
  articles: Article[];
}

const BlogList = (props: Props): JSX.Element[] | null =>
  props.articles.length === 0
    ? null
    : props.articles.map(article => <BlogListItem article={article} />);

export default BlogList;
